import React from 'react';
import {Box, Modal} from '@mui/material';
import {CTAButton} from './components';


const ModalPopup = ({open, handleClose, text}) => {
  return (
    <Modal
        open={open}
        onClose={handleClose}
    >
        <Box className="modal-inner">
            <p>{text}</p>
            <CTAButton/>
        </Box>  
    </Modal>
  )
}

export default ModalPopup;
